import React from 'react';

const ImageChangeOnMouseOver = () => {
    const mystyle = {
        maxWidth: '200px',
    };
    return (
        <div>
            <img src="/static/dog1.jpg" alt="" />
            &nbsp;&nbsp;&nbsp;
            <img style={mystyle} src="/public/static/dog2.jpg" alt="" />
        </div>
    );
};

export default ImageChangeOnMouseOver;
